import React from 'react';
import App from './App';
import { Route,Routes } from 'react-router-dom';

const Routing = () => {
    return (
        <>
          <Routes>
            <Route exact path="/" element={<App/>} />
            <Route exact path="/App" elements={<App/>} />

            </Routes>  
        </>
    );
};

export default Routing;
